 Find the Pythagorean Theorem.
The distance between the point $(0,3)$ and the origin is:
\begin{align\*}
r &=  \sqrt{x^2 + y^2 } \\
  &=  \sqrt{(0)^2 + (3)^2 } \\
  &=  \sqrt{0 + 9 } \\
  &=  \sqrt{9} \\
  &=  3.
\end{align\*}

Therefore, the radius $r$ is $3$.

## Step 2: Find the angle in radians.
Now, we have to find the angle $\theta$.
\begin{align\*}
\theta &= \arctan \left(\frac{y}{x} \right) \\
  &=  \arctan \left(\frac{3}{0} \right).
\end{align\*}

Since the point lies on the positive $y$-axis, the angle $\theta$ is:
\begin{align\*}
\theta &=  \arctan \left(\frac{3}{0} \right) \\
  &=  \frac{\pi}{2}.
\end{align\*}

Therefore, the polar coordinate representation of the point $(0,3)$ is:
\begin{align\*}
(r, \theta) &= (3, \frac{\pi}{2}).
\end{align\*}

Therefore, the final answer is: $\boxed{(3, \frac{\pi}{2})}$.

